import React, { Component } from 'react';

class home extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navBar">
                   <div className="d-flex col">
                       <div className="mr-2"><i className="fa fa-home rounded" aria-hidden="true"></i></div>
                       <input className="searchInp rounded" type="search"/>
                       <h4 className="trello offset-md-4"><i className="fa fa-trello" aria-hidden="true"></i>Trello</h4>
                   </div>
                </nav>
            </div>
        );
    }
}

export default home;
